import React, { useState } from "react";
import { Menu, Button, Icon } from "antd";
import styled from "styled-components";

import { Link } from "react-router-dom";

import { LogoDiv, NavBar } from "./style";

// interface MenuDivProps{
//   show: boolean
// }

const MenuDiv = styled(Menu)<any>`
  list-style-type: none;

  font-weight: normal;
  letter-spacing: 0.14em;
  margin-top: 13px !important;
  background: lavender !important;
  position: absolute;
  top: 69px;
  right: 1px;
  @media (min-width: 1024px) {
    font-style: normal;
    position: initial;
  }

  @media (min-width: 1024px) {
    display: inline-flex;
  }
  display: ${props => (props.show ? "none" : "block")};
`;

const MenuItemDiv = styled(Menu.Item)`
  font-size: 15px;
  padding: 10px;
`;
const MobileButton = styled(Button)`
  display: block;
  margin: 20px 20px 0px auto;

  @media (min-width: 1024px) {
    display: none !important;
  }
`;

export default function Navbar() {
  const [show, setShow] = useState(true);

  return (
    <NavBar>
      <Link to="/">
        <LogoDiv>
          RAPID <br/>
          INNOVATION
        </LogoDiv>
      </Link>

      <MobileButton type="primary" onClick={() => setShow(!show)}>
        <Icon type={show ? "menu-unfold" : "menu-fold"} />
      </MobileButton>

      <MenuDiv show={show ? 1: 0}>
        <MenuItemDiv>
          <Link to="/about">About Us</Link>
        </MenuItemDiv>

        <MenuItemDiv>
          <Link to="/whyrapid">Why Rapid Innovation</Link>
        </MenuItemDiv>

        <MenuItemDiv>
          <Link to="/team">Team</Link>
        </MenuItemDiv>

        <MenuItemDiv>
          <Link to="/ourclients">Our Clients</Link>
        </MenuItemDiv>

        <MenuItemDiv>
          <Link to="/meeting">Request A Meeting</Link>
        </MenuItemDiv>

        <MenuItemDiv>
          <Link to="/createtoken">Create EOS Token</Link>
        </MenuItemDiv>
      </MenuDiv>
    </NavBar>
  );
}
